import React, {Component} from "react";
import CompanyInfo from "./CompanyInfo";
import "./companyCard.css";

export default class CompanyCard extends Component {
    render() {
        return(
            <div className="company-card">
                <img></img>
                <CompanyInfo/>
                <a href="#">Learn More</a>    
            </div>
        );
    }
}
